import React, { Component } from 'react';
import auth from '../Auth';

class SignIn extends Component {
    state = {  }
    render() { 
        return (
            <button onClick={() => auth.login(() => this.props.history.push('/list'))}>
                Login
            </button>
        );
    }
}
 
export default SignIn;
